import React from "react";
import bread from "../data/bread";
import "../stylesheets/HomeBread.scss";

export default function HomeBread() {
  return (
    <div className="homebread--wrapper">
      <div className="projects--items">
        {bread.map((item) => (
          <div key={item.title} className="projects--item">
            <div className="list--projects_right">
              <img
                className="list--project_img"
                src={item.image}
                alt="project"
              />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
